import styles from "./App.module.css";
import NavBar from "./components/Nav/NavBar";
import FullWidthSection from "./components/FullWidthSection";
import CentralSection from "./components/CentralSection";

function App() {
  return (
    <div className={styles.App}>
      <NavBar />
      <div className={styles.navbarSpacer}></div>
      <FullWidthSection>
        <div className={styles.panelsSpan}></div>
      </FullWidthSection>
      <FullWidthSection>
        <CentralSection>
          <div>
            Helio Solar provides quality Solar PV solutions, primarily in the
            lower mainland, but also servicing Vancouver island, the Okanagan,
            and the Cariboo/Chilcotin.
          </div>
        </CentralSection>
      </FullWidthSection>
    </div>
  );
}

export default App;
